import React from "react";
import Header from "../components/Header";
import Recepient from "../components/Recepient";
import Footer from "../components/Footer";

const RecepientPage = () => {
  return (
    <>
      <Header />
      <Recepient />
      <Footer />
    </>
  );
};

export default RecepientPage;
